let certificateModule = (function () {
  return {
    generateCertificate: function (data) {
      var imageData =
        "data:image/jpeg;base64,";
      //creating document
      let doc = new jsPDF();

      //add image of certificate
      doc.addImage(imageData, "JPG", 15, 40, 180, 140);

      //add the content of certificate
      doc.setFont("times");
      doc.setFontType("italic");
      doc.setTextColor(29, 210, 242);
      doc.setFontSize(21);
      doc.text(105, 76, "TYPING SPEED CERTIFICATE", "center");

      doc.setTextColor(96, 96, 96);
      doc.setFontSize(14);
      doc.text(105, 83, `This Certificate is Hereby Awarded to`, "center");

      let button = event.target,
        nameField =
          button.parentElement.previousElementSibling.children[1].children[1],
        nameFieldValue = nameField.value;
      doc.setTextColor(29, 210, 242);
      doc.setFontSize(19);
      doc.text(105, 90, nameFieldValue, "center");

      //save the document
      doc.save("certificate.pdf");
    },
  };
})();
